import React from 'react';

export default function Title() {
	return (
		<div
			style={{
				fontWeight: 900,
				fontSize: '5rem',
				lineHeight: '4rem',
				textShadow: 2,
			}}
		>
			<div
				style={{
					fontSize: '3rem',
				}}
			>
				TRAVELING &nbsp; AROUND
			</div>
			<div
				style={{
					fontSize: '5rem',
				}}
			>
				THE &nbsp; WORLD
			</div>
			<div
				style={{
					fontSize: '3rem',
				}}
			>
				HAS NEVER BEEN
			</div>
			<div
				style={{
					fontSize: '6rem',
				}}
			>
				SO EASY
			</div>
		</div>
	);
}
